{% endblock  %}

{% block _web_catalog_menu_second_level_column %}
    <div class=\"main-menu-column {{ addClass|default('') }}\">
        <p class=\"main-menu-column__title\">
            {{ label }}
        </p>
        <{{ contentTag|default('ul') }} class=\"main-menu-column__inner\">
            {{ content }}
        </{{ contentTag|default('ul') }}>
    </div>
{% endblock  %}

